// src/components/ResultsForm.js

import React from 'react';

const ResultsForm = ({ results }) => {
  return (
    <form>
      {Object.entries(results).map(([key, value]) => (
        <div key={key}>
          <label>{key}</label>
          <input type="text" value={value} readOnly />
        </div>
      ))}
    </form>
  );
};

export default ResultsForm;
